import React from 'react';
import axios from 'axios';

class Tt extends React.Component {
 constructor(props) {
  super(props)
         this.state = {
          persons: []
        }

}
componentDidMount() {
    axios.get(`http://localhost:5000/ttrecords`)
      .then(res => {
        const persons = res.data;
        console.log({persons});
        this.setState({ persons });
      })
  }  
  render() {
    return (
    <div className="App">
       <div className="left">
       <table>
        <tr>
          <th>id</th>
          <th>Phone</th>
          <th>Email</th>
          <th>Action</th>
        </tr>
        { this.state.persons.map(person => 
          <tr>
            <td>{person.ex_id}</td>
            <td>{person.name}</td>
            <td>{person.contact}</td>
            <td>
              <form onSubmit={this.handleEditSubmit}>
                  <button type="submit" value={person.ex_id} onClick={e => this.onEdit(e)}>Edit</button>
              </form>
               <form onSubmit={this.handleSubmit}>
                  <button type="submit" value={person.ex_id} onClick={e => this.onClick(e)}>Delete</button>
              </form>

            </td>
            </tr>
          )}
        </table>
      </div>    </div>
  );
  }
}
export default Tt;
